package chx.two.domain;

import java.util.Date;

public class Jiagong {

	private Integer id;
	private String name;
	private String job;
	private double price; 
	private Date huitime;
	private String bxren;
	private String tupian;
	private String lxren;
	private String jobprice;
	private String shren;
	private String biezhu;
	public Jiagong() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Integer getId() {
		return id;
	}
	public void setId(Integer id) {
		this.id = id;
	}
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	public String getJob() {
		return job;
	}
	public void setJob(String job) {
		this.job = job;
	}
	public double getPrice() {
		return price;
	}
	public void setPrice(double price) {
		this.price = price;
	}
	public Date getHuitime() {
		return huitime;
	}
	public void setHuitime(Date huitime) {
		this.huitime = huitime;
	}
	public String getBxren() {
		return bxren;
	}
	public void setBxren(String bxren) {
		this.bxren = bxren;
	}
	public String getTupian() {
		return tupian;
	}
	public void setTupian(String tupian) {
		this.tupian = tupian;
	}
	public String getLxren() {
		return lxren;
	}
	public void setLxren(String lxren) {
		this.lxren = lxren;
	}
	public String getJobprice() {
		return jobprice;
	}
	public void setJobprice(String jobprice) {
		this.jobprice = jobprice;
	}
	public String getShren() {
		return shren;
	}
	public void setShren(String shren) {
		this.shren = shren;
	}
	public String getBiezhu() {
		return biezhu;
	}
	public void setBiezhu(String biezhu) {
		this.biezhu = biezhu;
	}
	
	
	
	
	
}
